column1:
tradingependuser: title : market data api
description :
      market data api specification
endpoints :
    - get /market-data/{ticker}
      get the market data for a specific ticker.
    - get /market-data/{ticker}/history/{interval}
      get the market data for a specific ticker with history for a specific interval.
    - get /market-data/{ticker}/history/{interval}/{from}
      get the market data for a specific ticker with history for a specific interval from a specific date.

